// src/pages/Ministries.js
import React, { useContext } from 'react';
import MinistryCard from '../components/MinistryCard';
import { MinistryContext } from '../assets/context/MinistryContext'; // Assuming MinistryContext exists

const Ministries = () => {
  const { ministries } = useContext(MinistryContext) || {}; // Ensure ministries is an object to avoid destructuring error

  return (
    <div>
      <h1>Our Ministries</h1>
      {ministries && ministries.length > 0 ? (
        ministries.map((ministry) => (
          <MinistryCard key={ministry.id} {...ministry} />
        ))
      ) : (
        <p>No ministries available at the moment. Please check back later.</p> // Fallback for empty or undefined ministries
      )}
    </div>
  );
};

export default Ministries;
